import * as React from 'react';
import './Header.css'
import {Routes, Route, Link} from 'react-router-dom'

export interface IHeaderProps {
}

export default class Header extends React.Component<IHeaderProps> {
  public render() {
    return (
      <div>
          <div className='sideBar'>
            <Link className='link' to='/'><div className='navItem'> Dashboard<i/></div></Link>
            <Link className='link' to='/users'><div className='navItem'> Clientes<i/></div></Link>
            <Link className='link' to='/'><div className='navItem'> Conta<i/></div></Link>
            <a className="btn btn-primary" href="#collapseExample" role="button" aria-expanded="false" aria-controls="collapseExample">
              Link with href
            </a>
            <div  id="collapseExample">
              <div className="card card-body">
                Some placeholder content for the collapse component. This panel is hidden by default but revealed when the user activates the relevant trigger.
              </div>
            </div>
          </div>
      </div>
    );
  }
}
